import React from 'react' ;
import './Table.css' ;
import User from './UserList';



export class Table extends React.Component {
    render() {
        return (
            <div className = "Main-div">
                <table>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>E-mail</th>
                        <th>Address</th>
                    </tr>
                    <User />
                </table>
            </div>
        );
    }
}
